//SPDX-License-Identifier: MIT
pragma solidity ^0.6.0;
pragma experimental ABIEncoderV2;

contract Voting {
    uint256 public nextElectionId = 1;
    mapping(uint256 => Election) elections;

    mapping(address => Voter) voters;
    // address[] public votersList;

    struct Election {
        uint256 electionId;
        string electionName;
        address creatorId;
        string password;
        bool hasPassword;
        uint256 startDate;
        uint256 endDate;
        bool isActive;
        string[] candidates;
        string electionCover;
        // Voter[] voter;
    }

    struct Voter {
        address voterId;
        bool voted;
        string firstName;
        string lastName;
        // Election[] participatedElection;
    }

    function registerUser(
        address voterId,
        string memory firstName,
        string memory lastName
    ) public {
        Voter storage user = voters[voterId];
        user.voterId = voterId;
        user.firstName = firstName;
        user.lastName = lastName;
    }

    function getUser(address id)
        public
        view
        returns (
            address,
            string memory,
            string memory
        )
    {
        return (voters[id].voterId, voters[id].firstName, voters[id].lastName);
    }

    function createElection(
        string memory electionName,
        address creatorId,
        string memory password,
        bool hasPassword,
        uint256 startDate,
        uint256 endDate,
        bool isActive,
        string[] memory candidates,
        string memory electionCover
    ) public {
        Election storage newElection = elections[nextElectionId];
        newElection.electionId = nextElectionId;
        newElection.electionName = electionName;
        newElection.creatorId = creatorId;
        newElection.password = password;
        newElection.hasPassword = hasPassword;
        newElection.startDate = startDate;
        newElection.endDate = endDate;
        newElection.isActive = isActive;
        newElection.candidates = candidates;
        newElection.electionCover = electionCover;
        nextElectionId++;
    }

    function getAnElection(uint256 id)
        public
        view
        returns (
            // uint256,
            // string memory,
            // address,
            // string memory,
            // bool,
            // uint256,
            // uint256,
            // bool,
            // string[] memory,
            // string memory
            Election memory
        )
    {
        return elections[id];
        // return (
        //     elections[id].electionId,
        //     elections[id].electionName,
        //     elections[id].creatorId,
        //     elections[id].password,
        //     elections[id].hasPassword,
        //     elections[id].startDate,
        //     elections[id].endDate,
        //     elections[id].isActive,
        //     elections[id].candidates,
        //     elections[id].electionCover
        // );
    }
}
